    console.log(user);
    return (
      <>  
  {isAuthenticated && <div>Hello {user.name}</div>}
  {isAuthenticated && <div>Email: {user.email}</div>}
  {isAuthenticated && <div><img src={user.picture}/></div>}


      </>
    )


  }
}

export default withAuth0(Profile);
